INSERT INTO `t_parms` VALUES ('AC','Assignment Complete, Order pending with no Frame completion.'),('ACP','Aerial cable pair, usually stung on utlility poles and connects the central office to the premise'),('ADF','Automated Distribution Frame; designed to replace conventional main and intermediate frames'),('ADSL','Asymmetric Digital Subscribe Line; a high speed internet access service that utilizes existing copper telephone lines to send and receive data at speeds that exceed conventional dial-up modems'),('ADSR','Administration of Design Services Review; a field Identifier (FID) or tag that identifies a designed special service circuit'),('CA','Cancelled order, Pending order that has been cancelled; the service/work order is no longer to be processed; cross-connect cancellation work may or may not have been completed.'),('CARD','Card contains 32 X-ports  and 32 y-ports and is a slice of a three (3) stage matrix'),('CC','Completely Completed, Cross-connected ports/facilities are in or unconnected, appropriate testing has been done, and completion to FOMS.'),('CCPT','Carrier Controller Port (60 alphanumerics)'),('CEV','control environmental vault; a below ground structure, usually constructed of concrete, fiberglass, or steel, which houses electronic and/or optical equipment and associated equipment such as cross connect fields in a controlled temperature and humidity environment.'),('CKID','Circuit Identification, up to 60 characters that identify a communications path between two or more points '),('CLLI','Common Language Location Identifier is an eleven (11) character alphanumeric descriptor used to identify switches, point of interconnections and othe telephone network locations.'),('CLS','Class of Service (Resident (RES), Business (BUS), Coin (CN), Competitive Local Exchange Carrier (CLEC), Circuit Provisioning Center (CPC) and any user input up to 5 characters '),('CONN','Connected; port is part of a cross-connect; system status'),('CORBA','Common Object Request Broker Architecture; an emerging open distributed object computing infrastructure; automates many common network programming tasks such as object registration, location, and activation; request de-multiplexing; framing and error-handling'),('CP','Outside plant cable pair'),('CTID','Circuit Identifier, the ID of a facility which identifies a particular circuit.'),('CTTYPE','Circuit ID Type, specifies the type of facility whose ID will follow.'),('DAML','Digital Additional Main Line; digital line multiplexer 2N1, 4N1, 8N1, etc.'),('DCR','Direct Current Resistance'),('DEF','Defective; not available for cross-connect, status must be changed to SF or RS; flow-through cross-connect allowed and the appropriate jeopardy (A1, A2, or A4) is returned to FOMS with remark Port has defective status; port cannot be automatically selected for self-healing rearrangements.'),('DIP','Dedicated Inside Plant; treated as CONN, but does not contain a circuit ID, ADSR, CLS and protection.  A cross-connect path is in place. A DIP cross-connect is UPATED with CKID, ADSR, CLS, and status CONN using the Set-Up Service Connection Page'),('DNS','Domain Name Server '),('DS-1','Digital Signal Level 1; a digital line rate of 1.544 Megabits per second and carries 24 voice channels'),('DSL','Digital Subscriber Line; the digital line linking a customer site with the phone company; technologies such as ADSL, VDSL, and HDSL, can be used to provide high-speed multimedia services'),('DSLAM','Digital Subscriber Line Access Multiplexer; ADSL technology that aggregates the subscriber line traffic onto higher speed links for the backbone switching equipment'),('DSP','Digital Signal Processor'),('EID','Employee Identifier Number, used as the temporary password'),('EID#','Employee Identifier Number, used as the temporary password'),('EM','Element Manager; IPC web-based software control system accessed by the use of a GUI at the local access port; provides local user login access to the IPC at the central office, an Intranet, or a VPN'),('EMS','element management system'),('ESP','Enhanced Services Platform; a highly sophisticated software application that provides the command interface to the cross-point matrix'),('FAC ID','Facility Identifier'),('FAC TYP','Facility Type Bridge Lifter (BL),Carrier Controller Port (CCPT),cable pair (CP),Intelligent Controller Equipment (ICE), miscellanous Equipment (ME),orginating equipment (OE),tie pair (TP),Trunk Pair (TKP),transmission equipment (TRE)'),('FC','Frame Complete,  Cross-connects are in and testing has been completed, but completion has not been sent to FOMS.'),('FCIF','Flexible Computer Interface Format; protocol used by Telcordia OSSs'),('FDD','Frame Due Date,the date by which the \'framework\' (connections or disconnections) must be done.'),('FOMS','Frame Operations Management System; a Telcordia OSS.'),('FRLOC','Frame Location (6 alphanumerics (FXXXXX))'),('GPS_Adr','Global Positioning System Address'),('GUI','Graphical User Interface; internet browser interface'),('IC','Installation Complete,  Outside installation work has been completed but order has not received Frame completion.'),('ICE','Intelligent Controller Equipment (7-17 alphas)'),('ILEC','Incumbent Local Exchange Carrier, an original Bell System company providing intra-LATA communications'),('IPC','Intelligent Provisioning Center; an automated distribution frame manufactured by Telepath Networks, Inc.'),('IPC Gatewa','a web-based software control server system that provides access for many simultaneous users to control scores of IPCs from anywhere on an Intranet or VPN.  The IPC Gateway also facilitates the interface for flow-through provisioning.'),('IPC MOD','IPC MODEL identifies the model of the unit such as 192MRT, 384, 512, etc.'),('IPC TYP','IPC TYPE identifies the IPC as Central Office or OutSide Plant '),('ISDN','Integrated Services Digital Network in which the same time division switches and digital transmission paths are used to establish connections for different services via a limited set of standard multipurpose user-network interfaces'),('JR','Jeopardy Reason Code, specifies the jeopardy reason code to be placed on a circuit.'),('LAN','Local Area Networks; a network permitting the interconnection and intercommunication of a group of computers, primarily for sharing of resources such as data storage devices and printers'),('LCK','Locked; port status when a matrix card or matrix shelf are locked;  the LCK status can not be changed when ports were locked with the Lock/Unlock Matrix Card or Lock/Unlock Matrix Shelf commands; locked ports can not be automatically selected for self-healing rearrangements; system status.'),('LEC','Local Exchange Carrier, a telephone company providing intra-LATA communications'),('LOC ADR','Local Address, physcial address of the central office '),('LOOPBK','Loopback; used to specify ports used to loop a circuit.'),('LPBK','Loopback; LPBK status can only be entered on the Provisioning  Setup Service Connection web page'),('LST','Line and Station Transfer, requires a Go-Ahead from the responsible group or field technician.'),('MAINT','Maintenance Connection  port is temporarily connected to a testing port, i.e., short, tone, look-in, or look-out; a system status.'),('ME','Miscellaneous Equipment (60 alphanumerics)'),('MLO','Multi line order, required when multiple circuits are associated with an order number. MLO Y will allow the IPC EM to accept the same order number for an additional circuit and cross connect'),('MLPT','Multipoint; used to specify the port is used as a bridge point, current port status must be CONN.  MLPT status can only be entered on the Provisioning  Setup Service Connection web page'),('MTCD','Maintenance Disconnect; ports are part of a cross-connect that have been temporarily disconnected to facilitate connection to testing ports, i.e., short, tone, look-in, or look-out; a system status.'),('NOSCM','No SCM, indicates that the contract contains work for a ckid that has been modified, cancelled, due date or frame due date change (CDD), or had both a modification and a DD/FDD change (MDD) before it mode'),('NPANXX','Numbering Plan Arrangement (6 numeric characters)'),('OCTID','OLD Circuit Identifier, specifies the ID of the facility which previously identified a particular circuit.'),('OCTTYPE','Old Circuit ID Type, Specifies the type of facility whose ID will follow.'),('OE','Originating Equipment; switching dial tone-producing equipment'),('OOS','Out Of Service; Status used to identify a port when the port matrix card or matrix shelf is removed; a system status.'),('ORDNO','Order Number, maximum 20 character stored against ports for 30 days or until disconnected or rearranged'),('OSP','Outside Plant;facilities terminating out of the central office '),('OT','Order Type, specifies the type of order for which connection data is being sent, or the type of a related order.'),('PATH','a beginning and end location'),('PATH ID','Path Identification, assigned route through matrix I/O and R matrix cards '),('PC','Pending Connect, Unconnected ports/facilities that have a connect order pending processing.'),('PD','Pending Disconnect, Connected ports/facilities that have a disconnect order pending processing.'),('PK','Pending Disconnect/Pending Connect,  Connected ports/facilities that have both a disconnect order and a connect order pending processing or PC/PD (Pending Connect/Pending Disconnect)  Unconnected pormode'),('PRI','Priority, Indicates the level of urgency of making the connections/disconnections in this contract.'),('PROT','Protection,marking used for identifying special services circuits, SSM (Special Safeguarding Measures) and (SSP) Special Service Protection'),('PS/C','Power Supply/Controller'),('RCP','Riser Cable Pair, runs between floors in a building, usually in an elevator shaft or conduit.'),('REG','Range Extender with Gain Unit; a device that permits a CO to serve a line that has resistance that exceeds the normal limit for signaling'),('REPEAT CON','connects the same ports repeatedly'),('RJR','Remove Jeopardy Reason, specifies that the order/circuit is to be removed from jeopardy.'),('RS','Reserved; available for cross-connect; port cannot be automatically selected for self-healing rearrangements.'),('SA','Service Affecting'),('SEVERITY','Severity, type of alarms, critical, Major,minor, and cleared'),('SF','Spare Facility; available for cross-connect; default status when port is mapped; system status.'),('SIP','Session Initiation Protocol; a signaling protocol for Internet conferencing, telephony, presence, events notification, and instant messaging'),('SP','Scan Point;a physcial termination on a frame that involts voltage'),('SPDT','a single pole double throw relay'),('SPECFUNC','Specific Functionality (4 alphas)'),('SSM','Special Safeguarding Measures; markings used for identifying special service circuits'),('SSP','Special Service Protection; markings used to prevent special service circuits service interruptions'),('STAT','Status occurs as a process is completed  '),('T ZONE','Time Zone, a region of the Earth that has adopted the same standard time, usually referred to as local time'),('TEMS','Transparent Embedded Magnetic Switches, micro magnetic latching switches; devices integrated onto a single module that forms an input/output cross-point matrix'),('TERM ADR','Terminal Address, physcial location for an OSP terminal'),('TERM ID','Terminal Identification,the name used to identify a terminal '),('TKP','Trunk Pair (15 alphanumerics (XXXXXXXXXX-NNNN))'),('TKTNO','Ticket Number, used to identify maintenace on a circuit'),('TL1','Transaction Language 1; a machine-to-machine communications language that is subset of CCITTs man-machine language.'),('TP','Tie Pair (15 alphanumerics (XXXXXXXXXX-NNNN))'),('TRE','Transmission Equipment (60 alphanumerics)'),('TST','Test; spare status for test access and maintenance fault test ports.'),('UAS','Unassigned; not available for cross-connect; matrix card is present port has not been mapped; system assigned status; system status.'),('UCP','Underground Cable Pair, cable that transition inside cable to outside plant.'),('UNQ','Unequipped; not available for cross-connect; Port has been mapped but no matrix card is present, system assigned status; system status.'),('USER GROUP','User Group defines permission for user'),('USER NAME','User name is the login for a user, remains with the user for all transaction'),('VPN','virtuasl private network; network that is constructed by using the Internet as the medium for transporting data; use encryption and other security mechanisms to ensure that only authorized users can access the network and that the data cannot be intercepted.'),('WAN','Wide Area Network; a network that covers an extended geographical area; typically uses links provided by inter-exchange carriers and /or local telephone companies.'),('WCC','Wire Center Code'),('WK','Working; used when a facility is assigned as a working circuit such as a screening OE but is not cross-connected to another port; port must have CKT ID with this status and entries of CLS, ADSR, and PROTECT are allowed; status used with import file for bulk port mapping.  Status is also available for cross-connect with auto cross-connect discovery, WK status is used as the key for identifying cross-connect auto-discovery candidates.'),('X-PORT','IPC port on a matrix card; typically used for equipment terminations'),('XC','Cancel Completed, Cancelled service/work order is completed and completion sent to FOMS.'),('XCC','Cross Connect Conflict'),('Y-PORT','IPC port on a matrix card; typically used for facility terminations');
